import React, {Component} from 'react';
import '../index.css';

class Recommendations extends Component{
    state = {
        books: [
            {name: "Harry Potter"},
            {name: "Micheal Vey'"},
        ]
    }
    render() {
        return (
            <div>
                {this.state.books.map(book = () => {
                    return (
                        <Book name = {books.name} />
                    );
                })}
            </div>
        )
    }
}

export default Recommendations;
